const NAMESPACE = 'services';

const SERVICE_CATALOGS = [
  'discovery',
  'limited',
  'signin',
  'postauth',
  'custom'
];

const SERVICE_CATALOGS_ENUM_TYPES = {
  STRING: 'SERVICE_CATALOGS_ENUM_TYPES_STRING',
  NUMBER: 'SERVICE_CATALOGS_ENUM_TYPES_NUMBER'
};

export {
  SERVICE_CATALOGS_ENUM_TYPES,
  NAMESPACE,
  SERVICE_CATALOGS
};
